[include shell_command.cfg]
[include mainsail.cfg]
[include homingoverride.cfg]
[include Adaptive_Mesh.cfg]
[include K-ShakeTune/*.cfg]
[include moonraker_obico_macros.cfg]



[virtual_sdcard]
path: /home/biqu/printer_data/gcodes
on_error_gcode: CANCEL_PRINT


[pause_resume]
[display_status]

[mcu]
#serial: /dev/serial/by-id/usb-Klipper_stm32g0b1xx_300017000C504B5735313920-if00
canbus_uuid: d7b40aec9b11

[mcu EBBCan]
#serial: /dev/serial/by-id/usb-Klipper_Klipper_firmware_12345-if00
canbus_uuid: 3b3754949999 #0e0d81e4210c

[mcu CB1]
serial: /tmp/klipper_host_mcu

[printer]
kinematics: corexy
max_velocity: 600
max_accel: 20000
max_accel_to_decel: 10000
max_z_velocity: 8
max_z_accel: 500
square_corner_velocity: 8

[force_move]
enable_force_move : True

[gcode_arcs]
resolution: 1.0

[output_pin caselight]
pin: PA7

[filament_switch_sensor fila]
pause_on_runout: True
runout_gcode:
            PAUSE
            SET_FILAMENT_SENSOR SENSOR=fila ENABLE=1
event_delay: 3.0
pause_delay: 0.5
switch_pin: !PC15

#[neopixel my_neopixel1]
#pin: PC11

#[neopixel my_neopixel2]
#pin: PC14

[adxl345]
cs_pin: EBBCan: PB12
spi_software_sclk_pin: EBBCan: PB10
spi_software_mosi_pin: EBBCan: PB11
spi_software_miso_pin: EBBCan: PB2
axes_map: x,y,z

[resonance_tester]
accel_chip: adxl345
probe_points:
   140,140, 20
   
########################################
# Stepper configuration
########################################

[stepper_x]
step_pin: PC8
dir_pin: PC9
enable_pin: !PA15
microsteps:16
rotation_distance: 39.96
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin:tmc2209_stepper_x:virtual_endstop
#endstop_pin:^PD3
position_min: -11
position_endstop:-11
position_max:280
homing_speed:30
homing_retract_dist:0
homing_positive_dir:False
step_pulse_duration:0.000002

[stepper_y]
step_pin: PA10
dir_pin: PA14
enable_pin: !PA13
microsteps: 16
rotation_distance: 39.96
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper
endstop_pin:tmc2209_stepper_y:virtual_endstop
#endstop_pin:^PD2
position_min: -24  
position_endstop: -24
position_max: 280
homing_speed:30
homing_retract_dist:0
homing_positive_dir:False
step_pulse_duration:0.000002

[stepper_z]
step_pin: PC6
dir_pin: PC7
enable_pin: !PA9
microsteps: 16
rotation_distance: 8
full_steps_per_rotation: 200
endstop_pin:probe:z_virtual_endstop #!PC3 #for Z-max; endstop have'!' is NO
#endstop_pin:^PC3
#position_endstop:15
position_max:280
position_min: -6
homing_speed: 5
homing_retract_dist: 8.0
homing_retract_speed: 2
second_homing_speed: 1
homing_positive_dir:false
step_pulse_duration:0.000002

[extruder]
step_pin: EBBCan:PD0
dir_pin: !EBBCan:PD1
enable_pin: !EBBCan:PD2
gear_ratio: 1628:170
microsteps: 16
full_steps_per_rotation: 200
rotation_distance: 53.5
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: EBBCan:PB13
sensor_type: Generic 3950
sensor_pin: EBBCan:PA3
min_temp: 0
max_temp: 360
min_extrude_temp: 170
smooth_time: 0.000001

